import { Link, Route } from 'react-router-dom';

class BlogPost extends React.Component {
    constructor(props) {
    super(props);
    }

    render() {
        console.log(this.props.match.url)

        let title = 'title';
        let published = 'date';
        let body = 'body';

		return (

	      <div className='blog-post-wrapper'>

	      <h1> {title} </h1>
	      <h2> {published} </h2>
	      <p> {body} </p>

	      </div>

		)

  }
}
export default BlogPost;
